import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ClassList() {
    const [classes, setClasses] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5000/api/classes')
            .then(response => {
                setClasses(response.data);
            })
            .catch(error => {
                console.error('There was an error fetching the classes!', error);
            });
    }, []);

    return (
        <div>
            <h2 className="mb-4">Class Schedule</h2>
            <div className="row">
                {classes.map(cls => (
                    <div className="col-md-4 mb-4" key={cls._id}>
                        <div className="card h-100">
                            <div className="card-body">
                                <h5 className="card-title">{cls.name}</h5>
                                <h6 className="card-subtitle mb-2 text-muted">{cls.category}</h6>
                                <p className="card-text">{cls.description}</p>
                                <p><strong>Instructor:</strong> {cls.instructor}</p>
                                <p><strong>Schedule:</strong> {new Date(cls.schedule).toLocaleString()}</p>
                                <p><strong>Duration:</strong> {cls.duration} minutes</p>
                                <p className="fs-5"><strong>Price:</strong> ${cls.price}</p>
                                <button className="btn btn-primary">Book Now</button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default ClassList;
